import React from 'react';

function Resume() {
  return (
    <section id="resume" style={{ padding: '20px', textAlign: 'center' }}>
      <h2>Resume</h2>
      <a href="C:/Users/m1500/shuda-page/file/Shuda_Yang resume.pdf" download="Shuda_Resume.pdf" style={{ textDecoration: 'none', color: 'blue' }}>
        Download My Resume
      </a>
      <h3>Education</h3>
      <ul>
        <li>Bachelor's in Applied Mathematics Science - University of Connecticut</li>
        <li>Master's in Applied Economics - Johns Hopkins University</li>
      </ul>
    </section>
  );
}

export default Resume;
